import React from 'react';
import {Outlet} from "react-router-dom";

const Entire = () => {
	return (
		<div>
			<nav>
				<div>{'创建新问卷'}</div>
				<div>{'草稿'}</div>
				<div>{'已发布的问卷'}</div>
				<div>{'参与过的问卷'}</div>
			</nav>
			<Outlet/>
		</div>
	);
};

export default Entire;
